import GeneralButton from "../GeneralUI/GeneralButton";
import GeneralInput from "../GeneralUI/GeneralInput";
import styles from "./ContactCard.module.css";

const ContactCard = (props) => {
  return (
    <form className={styles.container} style={props.style}>
      <div className={styles.simple}>Phone</div>
      <div className={styles.simple}>Email</div>
      <div style={{ display: "flex" }}>
        <GeneralInput
          type="text"
          label="Questions + Comments"
          style={{ borderRadius: "3px" }}
        />
      </div>
      <GeneralButton
        style={{
          margin: "2rem",
          width: "4rem",
          backgroundColor: "transparent",
          boxShadow: "none",
        }}>
        Send
      </GeneralButton>
    </form>
  );
};

export default ContactCard;
